import { Typewriter } from 'react-simple-typewriter'


function Home() {
    return(
      <div className="home"> 
        <div className="homeBox">
          <Typewriter  className="homeType"
            cursor
            cursorStyle='_'
            typeSpeed={70}
            deleteSpeed={50}
            delaySpeed={1000}
            words={['Welcome to Give Good'] }/>


        </div>
      </div>
  );

}

export default Home;
